const betExecutor = async (dataId, winSide, betSize, betSpeed) => {
 let bodyCheckTime = 19;
 let inputCheckTime = 19;
 let betSizeCheckTime = 19;
 let checkboxCheckTime = 19;
 let buttonCheckTime = 19;
 let time = 18


 if (betSpeed === 'force') {
 await elementClick(dataId, winSide)
 } else if (betSpeed === 'normal') {
 const randomSpeed = chance.integer({ min: 750, max: 1000 })
 await moveToElementAndClick(dataId, winSide, randomSpeed, randomSpeed / 17, randomSpeed / 50);
 }



 if (await recursiveCheckBody(bodyCheckTime)) {
 if (await recursiveInputCheck(inputCheckTime)) {
 await enterBetSize(betSize);
 if (await recursiveBetSizeCheck(betSize, betSizeCheckTime)) {
 await checkboxCheck()
 if (await recursiveCheckBoxCheck(checkboxCheckTime)) {
 if (await recursiveBetButtonCheck(buttonCheckTime, betSize)) {
 await pressEnter()
 if (await recursiveCheckBodyActive(time, betSize)) {
 return true
 } else {
 console.log('Ставка не сделана, т.к. все еще активен диалог')
 await renderScreenshot()
 GLOBAL_LOG.push(pushError('betExecutor', 'Ставка не сделана, т.к. все еще активен диалог'))
 await sendError('betExecutor, Ставка не сделана, т.к. все еще активен диалог')
 return false
 }
 } else {
 console.log('Кнопка в состоянии disabled')
 await renderScreenshot()
 GLOBAL_LOG.push(pushError('betExecutor', 'Кнопка в состоянии disabled'))
 await sendError('betExecutor, Кнопка в состоянии disabled')
 return false
 }
 } else {
 console.log('Чекбокс не в состоянии checked')
 await renderScreenshot()
 GLOBAL_LOG.push(pushError('betExecutor', 'Чекбокс не в состоянии checked'))
 await sendError('betExecutor, Чекбокс не в состоянии checked')
 return false
 }
 } else {
 console.log('Ошибка при вводе размера ставки')
 await renderScreenshot()
 GLOBAL_LOG.push(pushError('betExecutor', 'Ошибка при вводе размера ставки'))
 await sendError('betExecutor, Ошибка при вводе размера ставки')
 return false
 }
 } else {
 console.log('Активный элемент не input')
 await renderScreenshot()
 GLOBAL_LOG.push(pushError('betExecutor', 'Активный элемент не input'))
 await sendError('betExecutor, Активный элемент не input')
 return false
 }
 } else {
 console.log('Активный элемент не body, ошибка в самом начале')
 await renderScreenshot()
 GLOBAL_LOG.push(pushError('betExecutor', 'Активный элемент не body, ошибка в самом начале'))
 await sendError('betExecutor, Активный элемент не body, ошибка в самом начале')
 return false
 }
}


const betManager = async (dataId, statusBuilder, winSide, betSize, betSpeed) => {
 let timeout = 60;
 let result = null;

 if (!BetCooldown) {
 betNumCounter++
 console.log('BET NUM: ' + betNumCounter)
 await readyControl()
 BetCooldown = true
 setTimeout(() => {
 BetCooldown = false
 }, 300)

 PLAYER_STATUS = 'betting'
 await syncRequest('simple');

 // result = await betExecutor(dataId, winSide, betSize, betSpeed);

 result = await betEvaluator(dataId, winSide, betSize, betSpeed);

 if (result) {
 tempNowStatusData[dataId] = {}
 tempNowStatusData[dataId][statusBuilder] = {}
 tempNowStatusData[dataId][statusBuilder].STATUS = 'timeout'
 console.log('Timeout START')
 const intervalID = setInterval(async () => {
 try {
 timeout--
 if (timeout < 0) {
 console.log('Timeout END')
 clearInterval(intervalID)
 currentNowBets[dataId][statusBuilder].STATUS = 'ready'
 tempNowStatusData[dataId][statusBuilder].STATUS = 'ready'
 await syncRequest('simple')
 }
 } catch (e) {
 console.log('Ошибка интервала')
 GLOBAL_LOG.push(pushError('betManager', 'Ошибка интервала'))
 await sendError('betManager, Ошибка интервала')

 }
